import React from 'react';
import VectorImage from 'src/assets/images/start1_Vector.png';
import './footer.scss'

function Footer() {
    return (
        <div className='footer'>
            {/* <div id='Rectangle2'></div> */}
            <div id='Email'>
                <img id='Vector' src={VectorImage} loading="lazy" alt={'Vector'} /> 
            </div>
            <div id='AboutPrivacyFaq'>
            <a href="/about">About</a>
        <span>Privacy</span>
        <span>FAQ</span>
            </div>
        </div>   
    )
  }

  export default Footer;
